package com.studio.common.result;import java.util.Map;/** * description: * author:          song * createDate:      2018/1/11 */public class TreeResult {    public TreeResult() {    }    public TreeResult(String text) {        this.text = text;    }    private String id;    private String text;    private String iconCls;    private boolean checked;    private TreeState state;    private Map<String, Object> attributes;    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getText() {        return text;    }    public void setText(String text) {        this.text = text;    }    public String getIconCls() {        return iconCls;    }    public void setIconCls(String iconCls) {        this.iconCls = iconCls;    }    public boolean isChecked() {        return checked;    }    public void setChecked(boolean checked) {        this.checked = checked;    }    public TreeState getState() {        return state;    }    public void setState(TreeState state) {        this.state = state;    }    public Map<String, Object> getAttributes() {        return attributes;    }    public void setAttributes(Map<String, Object> attributes) {        this.attributes = attributes;    }}